'''
python의 decimal 라이브러리를 이용하자.

주의 반례
99.999999999 100
-> 99999999900000000049499999983830000003921224999247124800119205239983992439201860878942809776819177310309455023701953669042105103559457500642669426747902152866346996628980313301273694433080166479257066.
'''

import sys
from decimal import *

getcontext().prec = 1200     # 소수점 정확도 설정
input = sys.stdin.readline


def solve(A: str, B: str) -> Decimal:
    # '1E-10'과 같은 지수표현 방지를 위해 소수점 900자리까지 출력
    # 이후 오른쪽의 0 제거
    return format(Decimal(A) ** Decimal(B), '.950f').rstrip('0')
    

def main():
    A, B = map(str, input().split())
    print(solve(A, B))


main()